import { useState } from 'react';
import './index.css';

function App() {
  const [count, setCount] = useState(0);

  return (
    <div >
      <h1 className='select-none text-bold font-heading hover:text-xl' onClick={() => setCount(count + 1)}>Click on me !</h1>
      <div className='text-center'>
        <h1 className='text-sm text-center font-heading'>{count}</h1>
      </div>
    </div>
  )
}

export default App;
